function x($s, $k) {
    $o = "";
    for ($i = 0; $i < strlen($s); $i++) {
        $o .= chr(ord($s[$i]) ^ ord($k[$i % strlen($k)]));
    }
    return $o;
}

function d($e, $m, $k, $i, $f) {
    $fn = base64_decode($f[0]);
    return $fn($e, hex2bin($m[0]) . "-" . base64_decode($m[1]) . "-" . str_rot13($m[2]), $k, 0, $i);
}

function l($m, $f) {
    $fn = hex2bin($f[1]);
    return $fn(hex2bin($m[0]) . "-" . base64_decode($m[1]) . "-" . str_rot13($m[2]));
}

